import React from 'react';
import styled from 'styled-components';

const WheelContainer = styled.div`
  position: relative;
  width: 600px;
  height: 600px;
  margin: 0 auto;
`;

const WheelContent = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const CenterContent = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  text-align: center;
  z-index: 3;
  width: 120px;

  svg {
    width: 60px;
    height: 60px;
    margin-bottom: 8px;
  }

  h3 {
    margin: 8px 0 0;
    font-size: 14px;
    color: #333;
  }
`;

const ConnectingShape = styled.div`
  position: relative;
  width: 400px;
  height: 400px;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    border: 30px solid #e9a65b;
    border-radius: 50%;
  }
`;

const ComponentSection = styled.div`
  position: absolute;
  width: 100px;
  height: 120px;
  background-color: #51817c;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  color: white;
  clip-path: polygon(0 20%, 100% 20%, 80% 100%, 20% 100%);

  svg {
    width: 40px;
    height: 40px;
    margin-bottom: 5px;
    fill: currentColor;
  }

  .label {
    font-size: 12px;
    text-align: center;
  }

  &.top {
    top: -60px;
    left: 50%;
    transform: translateX(-50%);
  }

  &.right {
    right: -60px;
    top: 50%;
    transform: translateY(-50%) rotate(90deg);
  }

  &.bottom {
    bottom: -60px;
    left: 50%;
    transform: translateX(-50%) rotate(180deg);
  }

  &.left {
    left: -60px;
    top: 50%;
    transform: translateY(-50%) rotate(270deg);
  }
`;

const ConnectingText = styled.div`
  position: absolute;
  color: #e9a65b;
  font-size: 14px;
  font-weight: 500;

  &.policies {
    top: 25%;
    left: 15%;
  }

  &.conditions {
    top: 25%;
    right: 15%;
  }

  &.risks {
    bottom: 25%;
    left: 15%;
  }

  &.guardrails {
    bottom: 25%;
    right: 15%;
  }
`;

const components = [
  {
    id: 'teams',
    name: 'Teams',
    svg: <g><path d="M66.1995,94.6816c-1.3577-.085-2.7366-.1201-4.1084-.1201-1.3859,0-2.7505.0354-4.1155.113-1.697-2.9275-3.6626-5.7839-5.8335-8.563-3.5001.4172-6.9083,1.0679-10.1824,1.9231,2.2559,2.5388,4.2993,5.1904,6.1237,7.9058,6.0599,9.1287,9.4823,19.0989,9.4823,28.2488l9.0369.0002c-.0002-9.1501,3.4365-19.1204,9.4963-28.2493,1.8173-2.7222,3.8608-5.3738,6.1166-7.8982l-10.1753-1.9304c-2.1851,2.7788-4.1437,5.6428-5.8407,8.5701Z" style={{ fill: '#51817c' }}/></g>,
    position: 'top'
  },
  {
    id: 'resources',
    name: 'Resources',
    svg: <g><path d="M124.175,57.5657c-9.1357,0-19.106-3.4224-28.2346-9.4963-2.7224-1.8032-5.374-3.8467-7.9056-6.1096-.8625,3.281-1.5131,6.6895-1.9303,10.1895,2.7717,2.178,5.6426,4.1296,8.563,5.8337-.0776,1.3647-.1201,2.7363-.1201,4.1223,0,1.3577.0424,2.7295.1201,4.0942-2.9202,1.7041-5.7913,3.6558-8.5559,5.8406.4031,3.5005,1.0535,6.9084,1.9163,10.1895,2.5315-2.2627,5.1831-4.3062,7.9055-6.1094,9.1357-6.0669,19.106-9.5034,28.2418-9.5034v-9.051Z" style={{ fill: '#51817c' }}/></g>,
    position: 'right'
  },
  {
    id: 'execution',
    name: 'Execution',
    svg: <g><path d="M29.6279,62.0981c0-1.3716-.0354-2.7505-.1202-4.1082,2.9203-1.7043,5.7913-3.6558,8.556-5.8408-.4031-3.5002-1.0536-6.9082-1.9305-10.1895-2.5243,2.2559-5.1759,4.3135-7.8912,6.1094-9.1357,6.0671-19.1062,9.5037-28.2419,9.5037l.0002,9.051c9.1357,0,19.106,3.4224,28.2346,9.4963,2.7294,1.7961,5.3811,3.8538,7.9196,6.1094.8485-3.281,1.4991-6.6892,1.9164-10.1895-2.772-2.1777-5.6427-4.1294-8.5631-5.8335.0778-1.3647.1202-2.7366.1202-4.1084Z" style={{ fill: '#51817c' }}/></g>,
    position: 'bottom'
  },
  {
    id: 'actions',
    name: 'Actions',
    svg: <g><path d="M66.6096,0h-9.037c.0001,9.1501-3.4364,19.1204-9.4965,28.249-1.8171,2.7224-3.8607,5.374-6.1306,7.8984,3.2811.877,6.6823,1.5061,10.1895,1.9304,2.1921-2.7717,4.1437-5.6428,5.8408-8.5701,1.3647.0776,2.7366.1201,4.1083.1201,1.3859,0,2.7506-.0354,4.1154-.113,1.697,2.9275,3.6487,5.7981,5.8336,8.563,3.5143-.4172,6.9154-1.0608,10.1964-1.9236-2.2698-2.5383-4.3134-5.1899-6.1377-7.9053-6.0598-9.1287-9.4822-19.0989-9.4822-28.249Z" style={{ fill: '#51817c' }}/></g>,
    position: 'left'
  }
];

function FrameworkWheel({ onComponentSelect }) {
  return (
    <WheelContainer>
      <WheelContent>
        <ConnectingShape />
        <CenterContent>
          <svg viewBox="0 0 124.1752 124.1895">
            <g id="_4d242af2-080f-4c9d-85f3-bf09a0d3ece3_1">
              <path d="M76.0918,28.249c-3.1961.6505-6.5123,1.0678-9.8923,1.2658-1.3648.0776-2.7295.1131-4.1154.1131-1.3717,0-2.7435-.0424-4.1083-.1202-3.38-.1839-6.7035-.6082-9.8996-1.2588Z" style={{ fill: '#e9a65b' }}/>
            </g>
          </svg>
          <h3>Compliance & Alignment</h3>
        </CenterContent>

        {components.map((component) => (
          <ComponentSection
            key={component.id}
            className={component.position}
            onClick={() => onComponentSelect(component)}
          >
            <svg viewBox="0 0 124.1752 124.1895">
              {component.svg}
            </svg>
            <div className="label">{component.name}</div>
          </ComponentSection>
        ))}

        <ConnectingText className="policies">Policies</ConnectingText>
        <ConnectingText className="conditions">Conditions</ConnectingText>
        <ConnectingText className="risks">Risks</ConnectingText>
        <ConnectingText className="guardrails">Guardrails</ConnectingText>
      </WheelContent>
    </WheelContainer>
  );
}

export default FrameworkWheel;
